const _QRAPI = async (data, callback) => {
    var data = {
        "component": "qr",
        "estado": "cargando",
        "data": data,
        "type": "registro"
    }

    const options = {
        method: 'POST',
        body: JSON.stringify(data),
    };

    fetch('http://qr.servisofts.com/api/api', options)
        // fetch('http://192.168.3.2:30034/api', options)
        .then(response => response.json())
        .then(response => {
            callback(response);
        }).catch(err => {
            console.error(err)
        });
}

const Http = {
    URL_SERVER,
    URL_PAGE,
    POST,
    QRAPI,
    QRAPI2
}

export default Http;